import React from 'react';
import './Logout.css';
import { signOut } from "firebase/auth";
import { auth } from '../../../firebase';
import Media from 'react-media';

// Return View Sign Out
export default function ReturnLogouT() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='btn-logout'>
  <Logout />
 </div>
);
export const ScreenSmall = () => (
 <div className='btn-logout-sm'>
  <Logout />
 </div>
);
export const Logout = () => {

 const handleSignOut = (event) => {
  event.preventDefault();

  signOut(auth);
  window.localStorage.setItem('ACTIVE', JSON.stringify(false));
  window.localStorage.setItem('SEND_USER', JSON.stringify(null));
  window.localStorage.setItem('BUILD', JSON.stringify(false));
  window.localStorage.setItem('PHONE_USER_TRAFIK', JSON.stringify(true));
  window.location.href = "/";

 };

 return (
  <button className='Btn-Red' onClick={handleSignOut}>DÃ©connexion</button>
 )
};
